import React from 'react';
import { Container} from 'react-bootstrap';
import NavbarButom from '../components/NavbarButom';
import {  Link } from 'react-router-dom';

const HomePage = () => {
  
   const h1Style = {
              textTransform: "uppercase",
              fontFamily: "Anton, sans-serif",
              transform: "skewY(5deg) perspective(650px) scaleX(3.5) rotateY(-55deg) ",
              transformOrigin: "center right",
              lineHeight: 1.0,
              letterSpacing: "0.01em",
              fontSize: "9vw",
              color: "#000",
              fontWeight:"900",
  };
  return (
  <div
      style={{
        backgroundColor: "#3500ff",
        minHeight: "100vh",
        color: "white",
        paddingTop: "5rem",
        overflow: "hidden",
        position: "relative",
      }}
    >
      <Container fluid >
        <Container fluid className='pe-3' >
          <div className='text-end' style={{ position: "relative", zIndex: 2 }}>
            <div style={h1Style}>
               <Link to="/studio">
              <div className='py-2'>
               Studio<br />Mega
              </div ></Link>
              <Link to="/brigade">
              <div className='py-2'>
              The<br />Brigade
              </div></Link>
              <div className='py-2'>
               Push<br />Onx mask
              </div>
              <div className='py-2'>
              Icon - <br />motor<br />sport
              </div>
            </div>
          </div>
        </Container>
      <div
        style={{
          position: 'fixed',
          bottom: 80,
          left: 40,
          zIndex: 1000,
        }}
      >
         <div>
              <h1 className='' style={{ fontWeight: '900', lineHeight: '0.8', fontSize: '3rem' }}>VAN<br />HOLTZ<br />CO.</h1>
            </div>
        <NavbarButom />
        </div>
      </Container>
    </div>
  );
};

export default HomePage;
